import React,{Component} from 'react';
import Link from 'next/link';

class Home extends Component{
  constructor(props){
    super(props)
  }
  render(){
    return(
      <>
        <div>
          <nav>
             <a href="/">Home</a>-
             <a href="/contact">Contact</a>-
             <a href="/about">About</a>-
             <a href="/users">Users</a>
          </nav>
        </div>
        <h1>welcome to homepage</h1>
      </>
    )
  }
}

export default Home
